Configuration STIGWIN11 {    param    (        [parameter()]        [string]        $NodeName = 'localhost'    )        Import-DscResource -ModuleName PowerSTIG    Node $NodeName {        WindowsClient BaseLine {            OsVersion   = '11'	    SkipRule    = 'V-253495','V-253480','V-253282'             Exception   = @{                'V-253357' = @{                    ValueData = '1' # Required for using Azure Image Builder access to creation                }                'V-253491' = @{                    Identity = 'Guests'                 }            }        }    }}